import React from "react";
import { useLocation, useNavigate } from "react-router-dom";

const PredictionResult = () => {
  const location = useLocation();
  const navigate = useNavigate();

  const { result, filename } = location.state || {};

  if (!result || !filename) {
    return (
      <div className="flex justify-center items-center h-screen text-center">
        <p className="text-lg text-gray-600">
          No prediction data available. Please upload an image first.
        </p>
      </div>
    );
  }

  const imageUrl = `http://127.0.0.1:5000/uploads/${filename}`;

  return (
    <div className="flex justify-center items-center h-screen bg-gray-100 px-6">
      <div className="bg-white shadow-md rounded-lg p-6 w-full max-w-4xl flex flex-col lg:flex-row items-center lg:items-start">
        {/* Left Column: Image */}
        <div className="flex flex-col items-center lg:w-1/2">
          <h3 className="text-lg font-semibold text-gray-800 mb-4">
            Patient Original MRI Image
          </h3>
          <img
            src={imageUrl}
            alt="Uploaded MRI"
            className="max-w-full h-auto rounded-lg border border-gray-200"
          />
        </div>

        {/* Right Column: Result and Button */}
        <div className="flex flex-col lg:w-1/2 lg:pl-8 mt-6 lg:mt-0">
          <h3 className="text-lg font-semibold text-gray-800 mb-4">
            Medical Diagnosis
          </h3>
          <p className="text-gray-700 text-sm mb-6">
            <strong>Tumor Type:</strong> {result}
          </p>
          <button
            onClick={() => navigate("/")}
            className="bg-blue-500 text-white px-4 py-2 rounded-md hover:bg-blue-600 focus:ring-2 focus:ring-blue-400 focus:outline-none transition-all duration-200 w-32"
          >
            Go Back
          </button>
        </div>
      </div>
    </div>
  );
};

export default PredictionResult;
